//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// contract Calculator {
// string public name;
// string public  gender;
// int public score;
// uint public age;
// bool  public uploaded;
// }

contract calculator{
    int firstnumber;
    int secondnumber;

     function getfirstnumber(int _first) public {
        firstnumber = _first;
     }

     function getsecondnumber(int _second) public {
        secondnumber = _second;
     }

    function addition() public view returns (int){
        return firstnumber + secondnumber;
        }

        function subtractrion() public view returns (int){
        return firstnumber - secondnumber;
        }

        function division() public view returns (int){
        return firstnumber / secondnumber;
        }

        function multiplication() public view returns (int){
        return firstnumber * secondnumber;
        }
}

